                //}


                mappingData.mp_status = 'A';
                mappingData.mp_approveduser = mainLayout.loginUser.Username;
                mappingData.mp_updateuser = mainLayout.loginUser.Username;
                SaveMapping();
            }
            else
            {
                return;
